  FUNCTION cmfe_TimingSetOnC(timingType,timingSummaryFlag,timingFilenameSize,timingFilename,routineListNumStrings, &
    & routineListStringLength,routineList) &
    & BIND(C, NAME="cmfe_TimingSetOn")

    !Argument variables
    INTEGER(C_INT), VALUE, INTENT(IN) :: timingType
    LOGICAL, VALUE, INTENT(IN) :: timingSummaryFlag
    INTEGER(C_INT), VALUE, INTENT(IN) :: timingFilenameSize
    TYPE(C_PTR), VALUE, INTENT(IN) :: timingFilename
    INTEGER(C_INT), VALUE, INTENT(IN) :: routineListNumStrings
    INTEGER(C_INT), VALUE, INTENT(IN) :: routineListStringLength
    TYPE(C_PTR), VALUE, INTENT(IN) :: routineList
    !Function return variable
    INTEGER(C_INT) :: cmfe_TimingSetOnC
    !Local variables
    CHARACTER(LEN=timingFilenameSize-1) :: FortrantimingFilename
    CHARACTER(LEN=1,KIND=C_CHAR), POINTER :: timingFilenameCChars(:)
    CHARACTER(LEN=routineListStringLength-1) :: FortranroutineList(routineListNumStrings)
    CHARACTER(LEN=1,KIND=C_CHAR), POINTER :: routineListCChars(:,:)

    cmfe_TimingSetOnC = CMFE_NO_ERROR
    CALL C_F_POINTER(timingFilename,timingFilenameCChars,[timingFilenameSize])
    CALL CMISSC2FString(timingFilenameCChars,FortrantimingFilename)
    CALL C_F_POINTER(routineList,routineListCChars,[routineListStringLength,routineListNumStrings])
    CALL CMISSC2FStrings(routineListCChars,FortranroutineList)
    CALL cmfe_TimingSetOn(timingType,timingSummaryFlag,FortrantimingFilename,FortranroutineList,cmfe_TimingSetOnC)

    RETURN

