  FUNCTION cmfe_UserNumberGetRegionC(regionPtr,userNumber) &
    & BIND(C, NAME="cmfe_UserNumberGetRegion")

    !Argument variables
    TYPE(C_PTR), VALUE, INTENT(IN) :: regionPtr
    INTEGER(C_INT), INTENT(OUT) :: userNumber
    !Function return variable
    INTEGER(C_INT) :: cmfe_UserNumberGetRegionC
    !Local variables
    TYPE(cmfe_RegionType), POINTER :: region

    cmfe_UserNumberGetRegionC = CMFE_NO_ERROR
    IF(C_ASSOCIATED(regionPtr)) THEN
      CALL C_F_POINTER(regionPtr,region)
      IF(ASSOCIATED(region)) THEN
        CALL cmfe_UserNumberGet(region,userNumber,cmfe_UserNumberGetRegionC)
      ELSE
        cmfe_UserNumberGetRegionC = CMFE_ERROR_CONVERTING_POINTER
      ENDIF
    ELSE
      cmfe_UserNumberGetRegionC = CMFE_POINTER_IS_NULL
    ENDIF

    RETURN

  END FUNCTION cmfe_UserNumberGetRegionC

